import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_iphone.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_iphone.png'));

    // Wait for the search button (by class, first visible one)
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchBtn.click();

    // Wait for the search results header to appear
    await page.waitForSelector('text=Search Results for "iPhone"', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles from the results (first 5)
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.slice(0, 5).map(n => n.textContent.trim())
    );

    // Count number of results shown
    const resultsCountText = await page.$eval('.results-count', el => el.textContent);

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted product titles from results",
      extractedData: {
        resultsCountText,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
